import { Dashboard } from "./components/Dashboard";
import { Header } from "./components/Header";
import { GlobalStyled } from "./styles/global";


export function App() {
  return (
    <>
      <Header />
      <Dashboard />
      <Modal 
                  isOpen={isNewTransactionModalOpen}
                  onRequestClose={handlCloseNewTransactionModal}
              >
                  <h1>Cadastrar-se</h1>
              </Modal>
      <GlobalStyled />
    </>
  );
}
